const NoteCard = () => {
  return (
    <>
      <div className="form">
        <div class="form-div">
          <p class="form-label">Name</p>
          <input
            type="text"
            class="form-input input-focused"
            placeholder="normal"
            required
          />
        </div>
      </div>
    </>
  );
};

export { NoteCard };
